syntax = "proto3";

package tiktok_hack;

option java_multiple_files = true;
option java_package = "cool.scx.live_room_watcher.impl.tiktok_hack.proto_entity.webcast.data";
option go_package = "Sunny/tiktok_hack/generated/data";
// 更新时间 2024-06-06

// LiveMessageID 消息类型，可能用于存储直播消息的唯一标识信息
message LiveMessageID {
    // 主要ID，可能用于唯一标识直播消息
    string primary_id = 1;
    
    // 消息场景，可能用于描述消息使用的场景或分类
    string message_scene = 2;
  }
